import React from 'react';

export default function Posts(props){
  let post = props.post;
  let userId = props.post.userId;


  return(
    <div>
      <h1>POST</h1>
      <ul>
        <hr></hr>
        <li >{post.title} </li>
        <hr></hr>
        <li> {post.body}</li>  
        <hr></hr>
      </ul>
      <div>
        {userId}
      </div>
    </div>
  );
}
